import React, {useEffect, useState} from 'react';

function ClientInfo() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        const data = await fetch('/tweets');
        const items = await data.json();
        setItems(items);
    };

    return(
        <section>
            {
            items.map(item => (
                                <><h6>{item}</h6><p>{item}</p></>
            ))
            }
        </section>
    );
}

export default ClientInfo;
